// GetStartedPage.js

import React from 'react';
import { Navbar, Nav, Carousel } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './GetStartedPage.css';
import MATSYA from './images/matsya.png';
import Logo from './images/govtlogo.png';

import Img1 from './images/img1.png';
import Img2 from './images/img2.png';
import Img3 from './images/img3.png';
import Img4 from './images/img4.png';
import Img5 from './images/img5.png';
import Img6 from './images/img6.png';
import { Link } from 'react-router-dom';

const GetStartedPage = () => {
  return (
    <div className="get-started-page">
      <Navbar className='navbar'>
      <div>    
        <img src={MATSYA} alt="MATSYA Logo" />
        <p> MATSYA </p>
        </div>
  
        <Nav className="ml-auto">
          <Nav.Link href="https://example.com/link1">Link 1</Nav.Link>
          <Nav.Link href="https://example.com/link2">Link 2</Nav.Link>
        </Nav>
      </Navbar>

      <Carousel>
        <Carousel.Item>
          <img className="d-block w-100" src={Img1} alt="First slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={Img2} alt="Second slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={Img3} alt="Third slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={Img4} alt="Fourth slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={Img5} alt="Fifth slide" />
        </Carousel.Item>
        <Carousel.Item>
          <img className="d-block w-100" src={Img6} alt="Sixth slide" />
        </Carousel.Item>
      </Carousel>

      <div className="">
    <h1><Link to="/login">Welcome TO Matysa Portal Real Time</Link><div class="roller">
      <span id="rolltext">Flood Indundation<br/>
      Live Alerts<br/>
      Rescue,Relief<br/>
      <h1 id="spare-time">Want you Try?Seamless Experience</h1><br/>
      </span>
      </div>
      </h1>
      
    </div>

      <footer className="footer">
          <p1>Powered By: Ministry of Jal Shakti</p1>
        <p3>© Copyright SIH’23 Inn1vation Commandos</p3>
      </footer>
    </div>
  );
};

export default GetStartedPage;
